g2:c.PROCEDURE.g2:a.TEXT:
basic-bpms-processes-p-test(node:class benchmark-test )

win,win1:class g2-window;
initial-detection-logic-counter: integer;
initial-test-logic-counter: integer;
initial-response-logic-counter: integer;

begin

    for win = each g2-window do
        if the g2-window-management-type of win exists and the g2-window-management-type of win is local and the g2-window-width of win /= 22 then 
            begin
                win1=win;
            end;
    end;

    // remember current value of Detection logic counter of bpms-demo-domain-object-1
    initial-detection-logic-counter = the detection-logic-counter of bpms-demo-domain-object-1;
    change the text of  the individual-execution-display-mode of  bpms-demo-process-event-detection  to "none";
    // start bpms-demo-process-event-detection process
    // use start (not call) because bpms-demo-process-event-detection process contains breakpoint before its finish
    // therefore if we use call then process will not terminate  and G2 signaled that timeout limit expired
    start bpms-execute-process (bpms-demo-process-event-detection, bpms-demo-domain-object-1, win);
    // wait for process termination
    wait for 3 seconds;
    // we expect that Detection logic counter of bpms-demo-domain-object-1 incremented to 1
    if the detection-logic-counter of bpms-demo-domain-object-1 - initial-detection-logic-counter /= 1 then
    begin
        call fail(node, "Detection logic counter of bpms-demo-domain-object-1 do not changed properly.");
        return;
    end;
    
    // similar to bpms-demo-process-event-detection process
    initial-test-logic-counter = the test-logic-counter of bpms-demo-domain-object-1;
    change the text of  the individual-execution-display-mode of  bpms-demo-process-test  to "none";
    start bpms-execute-process(bpms-demo-process-test, bpms-demo-domain-object-1, win);
    wait for 3 seconds;
    if the test-logic-counter of bpms-demo-domain-object-1 - initial-test-logic-counter /= 1 then
    begin
        call fail(node, "Test logic counter of bpms-demo-domain-object-1 do not changed properly.");
        return;
    end;

    // similar to bpms-demo-process-event-detection process
    initial-response-logic-counter = the response-logic-counter of bpms-demo-domain-object-1;
    change the text of  the individual-execution-display-mode of  bpms-demo-process-response  to "none";
    start bpms-execute-process(bpms-demo-process-response, bpms-demo-domain-object-1, win);
    wait for 3 seconds;
    if the response-logic-counter of bpms-demo-domain-object-1 - initial-response-logic-counter /= 1 then
    begin
        call fail(node, "Response logic counter bpms-demo-domain-object-1 do not changed properly.");
        return;
    end;
    
    // passed
    call pass(node);

end

web-services-p-test(node:class benchmark-test )

err: class error;
begin

    // We launch procedures using call action instead start.
    // The goal is to catch all error signals in our handler.
    
    call bpms-demo-call-web-demo-request("http://localhost:8085/bpms/demo_http?arg1=123&arg2=test", structure(entity: "<?xml> <arg1> 23.4 </arg1> </xml>"));

    call gweb-call-soap-demo-request("http://localhost:8085/bpms/demo_soap", structure(
        action: "http://gensym.com/bpms/demo_soap",
        body-entries: sequence(
            structure(tag-name: "arg1", children: sequence("TIme: [the current time as a time stamp]")),
            structure(tag-name: "arg2", children: sequence("[random(1,1000)]")),
            structure(tag-name: "arg3", children: sequence("[random(1,1000)]"))
        )));
    
    call pass(node);
end
on error(err)
    post "[the name of this procedure]
[the text of the error-description of err]";
    call fail(node, the text of the error-description of err);
    delete err;
end

e-mail-p-test(node:class benchmark-test )

win,win1:class g2-window;
err: class error;

begin
    
    for win = each g2-window do
        if the g2-window-management-type of win exists and the g2-window-management-type of win is local and the g2-window-width of win /= 22 then 
            begin
                win1=win;
            end;
    end;

    // register our message board handler
    call g2-register-message-board-message-handler (e-mail-p-test-message-board-handler);
    call bpms-execute-process(bpms-demo-send-email , bpms-demo-domain-object-1, win);
    call g2-deregister-message-board-message-handler ();
    
    if the test-result of node is not failed then
        call pass(node);    // passed
end
on error(err)
    call g2-deregister-message-board-message-handler ();
    call fail(node, the text of the error-description of err);
    delete err;
end

{
    e-mail-p-handler(message: text) - 
    procedure for handling of message board messages
}
e-mail-p-test-message-board-handler(message: text)

send-mail-message-signature: text = "Send email result:";
send-mail-message-without-errors-signature: text = "Send email result: NONE";
pos: integer;

begin
    post "[message]";
    pos = position-of-text (send-mail-message-signature, message);
    // send mail error message?
    if pos > 0 and position-of-text (send-mail-message-signature, message) = 0 then
    begin
            call g2-deregister-message-board-message-handler();
            call fail(e-mail-p, "[get-from-text(message, pos, length-of-text(message))]"); // failed
    end
end

os-processes-p-test(node:class benchmark-test )

win,win1:class g2-window;
process-exists: truth-value;
windir: text;
imagename: text = "notepad.exe";
image-exists: truth-value;
time-of-kb-start: integer;
timeout-limit: integer;
timeout-limit-reserve: integer = 2;
err: class error;

begin

    time-of-kb-start = the current time;
    timeout-limit = the timeout-limit of node - timeout-limit-reserve;
    
    for win = each g2-window do
        if the g2-window-management-type of win exists and the g2-window-management-type of win is local and the g2-window-width of win /= 22 then 
            begin
                win1=win;
            end;
    end;

    // look image file in %windir%
    windir = call g2-get-environment-variable("windir");
    image-exists = call g2-file-exists("[windir]\System32\[imagename]");
    
    // is image file exists?
    if image-exists then
    
    // image file (notepad) exists
    begin   
        // check is process (notepad) launched or not
        process-exists = call os-process-exists-by-imagename(imagename);
        if process-exists then
        begin
            call fail(node, "[imagename] is already run. Please close it and run test again.");
            return;
        end;
        
        start bpms-execute-process(bpms-demo-orchestration-process, win);
        
        // wait for (notepad) process launching
        repeat
            allow other processing;
            process-exists = call os-process-exists-by-imagename(imagename);
            exit if process-exists or the current time - time-of-kb-start > timeout-limit;
        end;
        
        // if process not launched (it must already)  then test fail
        if (process-exists = false) then
        begin
            call fail(node, "[imagename] not launched");
            return;
        end;

        // wait for process termination
        repeat
            allow other processing;
            process-exists = call os-process-exists-by-imagename(imagename);
            exit if process-exists = false or the current time - time-of-kb-start > timeout-limit;
        end;
        
        // if process not terminated  then test fail
        if (process-exists) then
        begin
            call fail(node, "[imagename] is not terminated");
            return;
        end;
    end     // if image-exists then
    
    else
    
    // image file do not exists
    begin
         // wait for (notepad) process launching
        repeat
            allow other processing;
            process-exists = call os-process-exists-by-imagename(imagename);
            exit if process-exists or the current time - time > timeout-limit;
        end;
        
        if process-exists then
            call fail(node, "[imagename] not exists but launched. It is very strange.") // impossible
        else
            call pass-with-report (node, "[imagename] not found. Do you remove it?");
        return;
   end;

    // passed
    call pass(node);
end
on error(err)
//    if error signaled then put error message to tested node and delete the error object
    call fail(node, "[the text of the error-description  of err]");
    delete err;
 end

{   
    os-process-exists-by-imagename (imagename: text) > process-exists: truth-value 

    Argument            Description
    imagename        name of process image, by example "notepad.exe"

    Return Value        Description 
    process-exists    Truth-value that is true if the process exists, or false if it does not. 

    Description
    os-process-exists-by-imagename determines whether a process exists on the local system. 
    It  returns true if the process exists or false if it does not. 
    The procedure signals an error if it is unable to determine whether the process exists. 

}
os-process-exists-by-imagename(imagename: text)=(truth-value)

tasklist-result-filename: text = "tasklist-result.txt";     // name for temporary file
tasklist-result-file-length: integer;                               
tasklist-result-filestream: class g2-stream ;               
tasklist-pid: float;
tasklist-process-exists: truth-value;
err: class error;

begin
    // append path to tasklist-result-filename
    tasklist-result-filename = call grtl-get-absolute-path (tasklist-result-filename);

    // launch tasklist and redirect its output to file
    tasklist-pid = call g2-spawn-process-to-run-command-line ("tasklist /NH /FI @"IMAGENAME eq [imagename]@" | find @"[imagename]@" > @"[tasklist-result-filename]@"");
    
    // if tasklist do not launched then signal error
    if tasklist-pid = -1 then
    begin
        create an error err;
        change the text of the error-description of err to "Can not run tasklist.";
        signal err;
    end;
    
    // wait for tasklist exits
    repeat
        allow other processing;
        tasklist-process-exists = call g2-process-exists(tasklist-pid);
        exit if tasklist-process-exists = false;
    end;
    
    // get length of tasklist output file
    tasklist-result-filestream = call g2-open-file-for-read (tasklist-result-filename);
    tasklist-result-file-length = call g2-length-of-file(tasklist-result-filestream);
    call g2-close-file(tasklist-result-filestream);
    
    // if length of file then specified process exists, else not
    if tasklist-result-file-length /= 0 then
        return true
    else
        return false;
end
// catch error if any and rethrow it
on error(err)
    signal err;
 end

PING-AND-TRACEROUTE-P-test(node: class benchmark-test )

win,win1: class g2-window;
err: class error;
gerr-settings: class gerr-module-settings;
dispatch-developer-errors: truth-value;

begin

    for win = each g2-window do
        if the g2-window-management-type of win exists and the g2-window-management-type of win is local and the g2-window-width of win /= 22 then 
            begin
                win1=win;
            end;
    end;

    // get settings for GERR module
    begin
        gerr-settings = 
        call gfr-get-active-setting(the symbol gerr-module-settings, gfr-default-window); 
    end 
    on error (err)
        delete err;
        gerr-settings = gerr-default-module-settings;
    end;
    
    // remember current  state of dispatch-developer-errors flag
    dispatch-developer-errors = the dispatch-developer-errors of gerr-settings;
    
    // set dispatch-developer-errors flag  for display error messages that discarded on Message Board
    conclude that the dispatch-developer-errors of gerr-settings is true;
    call bpms-execute-process(bpms-demo-ping-and-trace-route , bpms-demo-domain-object-1, win);
    
    // restore dispatch-developer-errors flag
    if not(dispatch-developer-errors)  then
        conclude that the dispatch-developer-errors of gerr-settings is false;
    
    if the test-result of node is not failed then
        call pass(node);    // passed

end
on error(err)
    if not(dispatch-developer-errors)  then
        conclude that the dispatch-developer-errors of gerr-settings is false;
    call fail(node, the text of the error-description of err);
    delete err;
end

c.GFR-COMMUNICATIONS-HANDLER.g2:a.TEXT:
{
    ping-and-traceroute-communication-handler (Communication: class gfr-communication, 
    InitiatingItem: item-or-value, Client: class object) = (structure) - 
    communication handler for handling Message Board messages.

    It catch error messages from g2-ping and g2-trace-route.
    These functions are called indirectly from bpms-demo-ping-and-trace-route
    but error signals are suppressed.
}

ping-and-traceroute-communication-handler (Communication: class gfr-alert, 
    InitiatingItem: item-or-value, Client: class object) = (structure)
response: structure = structure();
begin
    if the text of the error-source-item of InitiatingItem = "g2-ping" then
    begin
        post "[the text of the error-description of InitiatingItem]";
        if the test-result of ping-and-traceroute-p is not failed then
            call fail(ping-and-traceroute-p, the text of the error-description of InitiatingItem);
    end;
    
    return response;
end

g2:c.PROCEDURE.g2:a.TEXT:
operator-messages-p-test(node:class benchmark-test )

win,win1:class g2-window;
max-time-to-wait-the-event: integer = 10;
time: integer;
displayed: truth-value;
err: class error;

begin

    // register message board message handler for log messages to message-list object
    call g2-register-message-board-message-handler (message-board-handler);
    
    for win = each g2-window do
        if the g2-window-management-type of win exists and the g2-window-management-type of win is local and the g2-window-width of win /= 22 then 
            begin
                win1=win;
            end;
    end;

    // If there exists a event as event that process shall create than fail.
    displayed = call operator-message-displayed-p();
    if displayed then
    begin
        call fail(node, "Message exists before tests executed.");
        go to complete;
    end;

    time = the current time;
    
    // Start the process
    start bpms-execute-process(bpms-demo-create-operator-message , bpms-demo-domain-object-1, win);
    
    // Wait for event up to max-time-to-wait-the-event seconds
    repeat
        allow other processing;
        displayed = call operator-message-displayed-p();
        exit if displayed or  the current time - time > max-time-to-wait-the-event;
    end;
    
    // If time expired but message not displayed then test failed
    if not (displayed) then
    begin
        call fail(node, "Message is not created.");
        go to complete;
    end;
 
    // The message is displaying on the screen during next 16 seconds.
    // This time is not equal to 10 seconds as  stated in comments 
    // for bpms-demo-create-operator-message.
    // Each activities after Wait Activity add additional delay.
   
    wait for 14 seconds;
    
    // If message is not displaying then text failed.
    displayed = call operator-message-displayed-p();
    if not (displayed) then
    begin
        call fail(node, "Message deleted early.");
        go to complete;
    end;

    // 14 + 2 = 16 seconds total
    wait for 2 seconds;
    
    // If message is displaying now then test failed
    displayed = call operator-message-displayed-p();
    if displayed then
    begin
        call fail(node, "Message is not deleted.");
        go to complete;
    end;

    wait for 1 second;
    
    if the test-result of node is not failed then
        call pass(node);    // passed
    
complete:    
    call g2-deregister-message-board-message-handler ();
end
on error(err)
    call g2-deregister-message-board-message-handler ();
    call fail(node, "[the text of the error-description of err]");
    delete err;
end

// Auxiliary procedure
// Return true if event exists
operator-message-displayed-p()=(truth-value)
begin
    return there exists a gevm-event e such that (
        the value of the gevm-priority of e = 7 and
        the text of the gevm-category   of e  = "@"BPMS Test@"" and 
        the text of the gevm-message  of  e = "@"This is a test message generated by the bpms-demo-create-operator-message.@"");
end

{
    message-board-handler(message: text) - 
    procedure for handling of message board messages
    Simply append message to message-list (g2-list instance) 
    and post message to message board
}
message-board-handler(message: text)

expected-message: text = 
"G2GL process BPMS-DEMO-CREATE-OPERATOR-MESSAGE
Number of messages:  .+";
not-found: structure = structure (token-type: the symbol goal, start-index: 0, end-index: 0);

begin
    post "[message]";
    // compare actual message with expected
    if  find-next-pattern(expected-message,  message, 1) = not-found then
        call fail(operatot-messages-p, "Unknown error.");
    call g2-deregister-message-board-message-handler();
end

database-p-test(node:class benchmark-test )

win,win1:class g2-window;
datasubwk:class kb-workspace;
ab:class uil-goto-workspace-button ;
datapool:class gdsm-database-connection-pool ;
err: class error;

begin

    for win = each g2-window do
        if the g2-window-management-type of win exists and the g2-window-management-type of win is local and the g2-window-width of win /= 22 then 
            begin
                win1=win;
            end;
    end;
    
    show BPMS-DEMO-TOP-LEVEL;
    for ab=each uil-goto-workspace-button upon bpms-demo-top-level do
        exit if the text of the label of ab="@"Services: Database@""
    end;
    datasubwk=the subworkspace of ab;
    show datasubwk at the center of the screen;

    datapool=the gdsm-database-connection-pool upon datasubwk;
    call gdsm-network-pool-initialize(datapool);
    
    conclude that the data of bpms-demo-domain-object-3 = "" ;
    
    call bpms-execute-process(BPMS-DEMO-DATABASES, bpms-demo-domain-object-3, win);
    
    post "[the data of bpms-demo-domain-object-3]";
    hide datasubwk;

    if the data of bpms-demo-domain-object-3 = ""
        then call fail(node, "Query result is empty.")       // set node state to failed
    else
        call pass(node);                                                   // passed
 end
 on error(err)
    post "[the text of the error-description of err]";
    call fail(node, "[the text of the error-description of err]");
    delete err;
 end

files-p-test(node:class benchmark-test )

win,win1:class g2-window;
filename: text = "bpms-demo-file-io-test.txt";
file-exists: truth-value;
search-result: structure;
expected-messages-pattern: text =
"G2GL process BPMS-DEMO-FILE-IO
Does file exist:  true
G2GL process BPMS-DEMO-FILE-IO
File content:  detection-logic-counter: .+ , test-logic-counter: .+ , response-logic-counter: .+";
err: class error;

begin

    for win = each g2-window do
        if the g2-window-management-type of win exists and the g2-window-management-type of win is local and the g2-window-width of win /= 22 then 
            begin
                win1=win;
            end;
    end;
    
    // File must not exist before test launching because test must create file itself.
    file-exists = call g2-file-exists(filename);
    if file-exists then
    begin
        call fail(node, "File @"[filename]@" exists before test run. Please remove it.");
        return;
    end;
    
    // register message board message handler for log messages to message-list object
    call g2-register-message-board-message-handler (files-p-test-message-board-handler);
    call bpms-execute-process(BPMS-DEMO-FILE-IO, bpms-demo-domain-object-1, win);
    call g2-deregister-message-board-message-handler ();

    // BPMS-DEMO-FILE-IO process must delete created file.
    // verify this
    file-exists = call g2-file-exists(filename);
    if file-exists then 
    begin
        call fail(node, "File @"[filename]@" not deleted.");
        return;
    end;

    // expecting then BPMS-DEMO-FILE-IO process posts two messages 
    // if not then test fail
    if the number of elements in message-list /= 2 then
    begin
        call fail(node, "Unknown error.");
        return;
    end;

    // check messages
    // compare actual messages with expected
    search-result = find-next-pattern(expected-messages-pattern,
        "[the first text in message-list]
[the second text  in message-list ]", 1);
    if the start-index of search-result = 0 and the end-index of search-result = 0 then
    begin
        call fail(node, "File @"[filename]@" input/output error.");
        return;
    end;

    // passed
    call pass(node);
end
on error(err)
    post "[the text of the error-description of err]";
    call g2-deregister-message-board-message-handler ();
    delete err;
end

{
    files-p-test-message-board-handler(message: text) - 
    procedure for handling of message board messages
    Simply appends message to message-list (g2-list instance) 
    and posts message to message board
}
files-p-test-message-board-handler(message: text)
list: class g2-list;
begin
    insert message at the end of message-list;
    post "[message]";
end

